return {
    type:"STATUSADD",
    payloud:status
}
}
export const initStatus=(status:status)=>{
    return {
        type:"STATUSINIT",
        payloud:status
    }
    }
export const deleteStatus=(status:status)=>{
    return {
        type:"STATUSDELETE",
        payloud:status
    }
     }
